import React from "react";

const Statistics = (statistics, title) => {
  return (
    <>
      {title ? <h2>{title}</h2> : ""}
      <ul>
        <li>
          <p>Followers</p>
          <p>6655</p>
        </li>
      </ul>
    </>
  );
};
export default Statistics;
